import React, {useContext} from "react";
import WikipediaContext from "../../utils/WikipediaContext"
import "./style.css";

function SearchResults() {
  const { title, description, url } = useContext(WikipediaContext)
  return (
    <ul className="list-group search-results">
      <li className="list-group-item">
        <h2>{title}</h2>
        <p>{description}</p>
        <a href={url}>{url}</a>
      </li>
    </ul>
  );
}

export default SearchResults;
